import React, { Component } from 'react'

export default class PostForm extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
             userId : '',
             title  : '',
             body   : ''
        }
    }
    
    render() {
        const {userId,title,body} = this.state;
        return (
            <form onSubmit>
            <input value={userId}
                   type='text'
                   name="userId"/> <br/>

                   <input value={title}
                   type='number'
                   name="title"/> <br/>

                   <input value={body}
                   type='text'
                   name="body"/>
            
                
            </form>
        )
    }
}
